  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Blackwater
  National Wildlife Refuge  outlines Refuge accomplishments during the 1996 calendar
  year. The report begins with a summary of the year's highlights and weather conditions.
  Land acquisition is covered. The report includes a planning section which discusses
  the management plan, public participation, compliance with environmental and cultural
  resource mandates, and research and investigations. Refuge administration is outlined;
  information about personnel, youth programs, volunteer programs, funding, safety,
  and technical assistance is given. Habitat management is also covered; subjects
  include wetlands, forests, croplands, fire management, and pest control. The wildlife
  section of the report discusses wildlife diversity, endangered and threatened species,
  waterfowl, shorebirds, raptors, game mammals, fisheries resources, animal control,
  and marking and banding. The public uses of the Refuge described in this report
  include hunting, fishing, trapping, wildlife observation, outdoor recreation, and
  law enforcement. The equipment and facilities section of the report provides information
  about new construction, rehabilitation, major maintenance, equipment replacement,
  communication systems, and computer systems. Cooperative programs and items of interest
  are provided at the end. Refuge brochures and field guides are included.\",\n\t\"owner_org\":
